int GetWeekday(const date &today)
{
	int sum = 0;
	for (int i = origin.year; i < today.year; ++i)
		sum += isLeapYear(i) ? 366 : 365;
	for (int i = 1; i < today.month; ++i)
	{
		switch (i)
		{
			case 1: case 3: case 5: case 7: case 8: case 10: case 12:
				sum += 31; break;
			case 4: case 6: case 9: case 11:
				sum += 30; break;
			case 2:
				sum += isLeapYear(i) ? 29 : 28; break;
			default:
				break;
		}
	}
	sum += today.day;
	--sum;
	return 1 + sum % 7;
}
inline bool isLeapYear(int year)
{
	return (year % 4 == 0 && year % 100 != 0) || year % 400 == 0;
}
bool isOK(const date &today)
{
	if (today.month == 1 && today.day == 1)
		return false;
	else if (today.month == 5 && today.day >= 1 && today.day <= 3)
		return false;
	else if (today.month == 10 && today.day >= 1 && today.day <= 7)
		return false;
	else
	{
		int Weekday = GetWeekday(today);
		if (Weekday == 6 || Weekday == 7)
		return false;
	}

	return true;
}
