int Calc(const date &first, const date &last)
{
	date today = first;
	int sum = 0;
	while (!(today.year == last.year && today.month == last.month && today.day == last.day))
	{
		if (isOK(today))
			++sum;
		switch (today.month)
		{
			case 1: case 3: case 5: case 7: case 8: case 10: case 12:
			{
				if (today.day == 31)
				{
					if (today.month == 12)
					{
						++today.year;
						today.month = 1;
						today.day = 1;
					}
					else
					{
						++today.month;
						today.day = 1;
					}
				}
				else
					++today.day;
				break;
			}
			case 4: case 6: case 9: case 11:
			{
				if (today.day == 30)
				{
					++today.month;
					today.day = 1;
				}
				else
					++today.day;
				break;
			}
			case 2:
			{
				if (isLeapYear(today.year))
				{
					if (today.day == 29)
					{
						++today.month;
						today.day = 1;
					}
					else
						++today.day;
				}
				else
				{
					if (today.day == 28)
					{
						++today.month;
						today.day = 1;
					}
					else
						++today.day;
				}
				break;
			}
			default:
				break;
		}
	}
	return sum;
}
